Romanian Deadlift Form: 
How to Perform the Exercise in 4 Simple StepsğŸ¬

Stand with your feet hip-width apart, holding a barbell at thigh level. Your hands should be about shoulder-width apart.
Keeping your back straight, bend at your waist and sit your hips back to lower the bar.
Keep the bar close to your shins and lower as far as your flexibility allows.
Forcefully contract your glutes to extend at your hips and stand up.
ğŸ’¡ The key is to begin with a loaded stretch on the hamstrings by performing the exercise from the top down, which should let you lower the bar to the floor. This allows you to pull the weight through a greater range of motion, which increases the effectiveness of the exercise.

The tricky part is this: as you come up to the top position, your pelvis needs to tilt backward so your glutes and hamstrings can fire.

You also need to make sure the bar travels in a straight line. To do this, keep the bar close to your body at all times and keep your shoulders over the bar. If the bar gets away from your body, you'll place sheering forces on your lower back and potentially set yourself up for an injury, especially as the weight gets heavier. â£
